@use './colors' as c;

.offers {
  // min-width: 10rem;
  &__subtitle {
    font-weight: 100;

    width: 90%;
    text-align: center;
    padding: 1.15rem;
    font-size: 1.1rem;
    min-width: fit-content;
    margin-top: 25px;
  }

  &__content {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
  }

  &__card {
    margin: 2rem auto;
    padding: 2rem;
    // padding: 1rem; >200vp
    border: 1px solid c.$parallax-border-color;
    // border: 1px solid black;
    border-radius: 0.5rem;
    -webkit-box-shadow: 1px 2px 16px -7px rgba(66, 68, 90, 1);
    -moz-box-shadow: 1px 2px 16px -7px rgba(66, 68, 90, 1);
    box-shadow: 1px 2px 16px -7px rgba(66, 68, 90, 1);

    &:nth-child(3) {
      padding: 2rem 2.73rem;
    }

    &-infoBox {
      margin-top: -1rem;
      padding: 0.5rem;

      &--title {
        font-size: 1.5rem;
        margin: 0.5rem auto;
      }
      &--price {
        font-family: var(--bold-font);
        font-size: 2.45rem;
        margin-bottom: 1rem;
      }
    }

    &-option {
      display: flex;
      margin: 0.25rem auto;
      // border: 1px solid;
      padding: 0.05rem 1rem;
      font-size: 0.95rem;

      &--image {
        margin-right: 0.5rem;
      }
    }
    &--button {
      margin-top: 1.5rem;
    }
  }
}

